import './Menu.css'


function Menu (props){

    return(
        <header>
        <nav classNme="header">
            <ul className="menu">
                <li className="men"><a href="http://localhost:3000">Home</a></li>
                <li className="men"><a href="#sobre">Sobre</a></li>
                <li className="men"><a href="#servicos">Serviços</a></li>
                <li className="men"><a href="#portifolio">Portifólio</a></li>
                <li className="men"><a href="#formulario">Contato</a></li>
            </ul>
        </nav>
        </header>
    )
}

export default Menu;
